window.bookSummaryJSON = "<p>Deadly twists and delicious romance—an all-new dark and highly addictive romantasy from USA Today bestselling author, Ella Fields.</p> <p>For twenty years, I’ve been an unwanted changeling. I have no name, no family, and no answers.</p> <p>Until an irresistibly wicked faerie begins a seductive game of cat and mouse. I am his prey. His treasure.</p> <p>A perfect pet.</p> <p>He offers a trade: he will take me to the faerie realms to assist in my search for the truth of who I am. In return, I must agree to marry him.</p> <p>But things are not as they seem, and soon after arriving at his wintry manor, I begin to unravel a dangerous web of lies.</p> <p>Far deadlier still, I'm falling in love with a monster who has no heart.</p> <p>This enemies to lovers fantasy romance contains a marriage of convenience, dark themes, a morally grey hero, and a high level of heat.</p>"; 
